import React, { Component } from 'react';
import { Layout, Menu, Breadcrumb } from 'antd';
import ReactDOM from 'react-dom';
import logo from './images/logo.png';
import './home.css';
import styled from 'styled-components';
const { Header, Content, Footer } = Layout;


const Container = styled.div`
  width: 100%;
  height: 60px;
  background-color: #47d147;
  display: flex;
  flex-direction: row;
  justify-content: center;
`;

const LeftContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: center;
  align-items: center;
  width: 30%;
  left: 40px;
`;

const RightContainer = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: right;
  align-items: center;
  width: 70%;
  padding-right: 30px;
  
`;

const PageLink = styled.a`
  padding-right: 10px;  
  font-size: 20px;
  text-decoration: none;
  color: black;
`;

class Home extends Component {
  render() {
    return (
      
      <Container>
        <LeftContainer>
        <PageLink href="/home" title="Tamaqtan"><img src={logo} className="logo"/></PageLink>    
        </LeftContainer>


        <RightContainer>    
          <PageLink href="/home" title="Рецепты">Главная</PageLink>      
          <PageLink href="/home" title="Рецепты">Рецепты</PageLink>
          <PageLink href="/profile" title="Вход">Супер поиск</PageLink>
          <PageLink href="/profile" title="Вход">Вход</PageLink>
        </RightContainer>
      </Container>
    
    
    );
  }
  
}

export default Home;
